import React from "react";
import './style.css';
import Card from "../Card";
import { getDefaultNormalizer } from "@testing-library/react";

const SideBar = props => {
    return (
        <>
        <div className = "sidebarContainer"></div>
        <Card width = '30%'>
            Sidebar
        </Card>
        </>
    )
};

export default SideBar;
